  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112339 includes biological,
  chemical, discrete sample, physical and profile data collected from HAKUREI MARU
  in the North Pacific Ocean and South Pacific Ocean from 1994-08-08 to 1994-10-06
  and retrieved during cruise NH94-2 and PACIFICA_49HG19940808. These data include
  ALKALINITY, CHLOROPHYLL A, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC
  PRESSURE, NITRATE + NITRITE CONTENT (CONCENTRATION), NITRITE, PHOSPHATE, SALINITY,
  SILICATE, WATER TEMPERATURE and pH. The instruments used to collect these data include
  CTD, Coulometer for DIC measurement and bottle. These data were collected by Akira
  Nishimura of Geological Survey of Japan and Yutaka W. Watanabe of National Institute
  for Resources and Environment as part of the PACIFICA_49HG19940808 data set.nnPACIFICA
  (PACIFic ocean Interior CArbon) was an international collaborative project for the
  data synthesis of ocean interior carbon and its related parameters in the Pacific
  Ocean. The North Pacific Marine Science Organization (PICES), Section of Carbon
  and Climate (S-CC) supported the project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
